import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import pageOne from "./PageOne";
import pageTwo from "./PageTwo";

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<pageOne />} />
          <Route path="/pageTwo" element={<pageTwo />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
